INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 102301, 0.0, "2020/07/31 12:00:00", 2, "やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 2, 24001, "2030/12/17 14:59:59", 401, 0.0, 24, 0.0, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 102301, 0.0, "2020/07/31 12:00:00", 1, "私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 2, 24002, "2030/12/17 14:59:59", 402, 2.21, 24, 0.0, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 102301, 0.0, "2020/07/31 12:00:00", 2, "やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 2, 24003, "2030/12/17 14:59:59", 403, 0.0, 24, 0.0, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192201, 0.0, "2020/07/31 12:00:00", 2, "特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 1, 24004, "2030/12/17 14:59:59", 701, 1.99, 24, 0.0, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192201, 0.0, "2020/07/31 12:00:00", 1, "よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 2, 24005, "2030/12/17 14:59:59", 702, 2.21, 24, 0.0, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192201, 0.0, "2020/07/31 12:00:00", 2, "試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 1, 24006, "2030/12/17 14:59:59", 703, 3.33, 24, 0.0, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192301, 0.0, "2020/07/31 12:00:00", 2, "このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 2, 24007, "2030/12/17 14:59:59", 801, 0.0, 24, 0.0, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192301, 0.0, "2020/07/31 12:00:00", 1, "オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 2, 24008, "2030/12/17 14:59:59", 802, 2.68, 24, 0.0, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192301, 0.0, "2020/07/31 12:00:00", 2, "いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 2, 24009, "2030/12/17 14:59:59", 803, 0.0, 24, 0.0, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192501, 0.0, "2020/07/31 12:00:00", 1, "やった！", 1, 24010, "2030/12/17 14:59:59", 501, 0.0, 24, 0.0, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192501, 0.0, "2020/07/31 12:00:00", 1, "勝ったよ！", 1, 24011, "2030/12/17 14:59:59", 502, 0.0, 24, 0.0, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192501, 0.0, "2020/07/31 12:00:00", 1, "いい調子！", 1, 24012, "2030/12/17 14:59:59", 503, 0.0, 24, 0.0, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, 0.0, "2020/07/31 12:00:00", 6, "あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 2, 24013, "2030/12/17 14:59:59", 111, 5.33, 24, 0.0, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, 0.0, "2020/07/31 12:00:00", 1, "みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 2, 24014, "2030/12/17 14:59:59", 112, 6.85, 24, 0.0, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, 0.0, "2020/07/31 12:00:00", 1, "練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 2, 24015, "2030/12/17 14:59:59", 113, 3.0, 24, 0.0, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192401, 0.0, "2020/07/31 12:00:00", 1, "まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 2, 24016, "2030/12/17 14:59:59", 611, 6.11, 24, 0.0, "ダイチ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192401, 0.0, "2020/07/31 12:00:00", 1, "ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 2, 24017, "2030/12/17 14:59:59", 612, 6.75, 24, 0.0, "ダイチ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192401, 0.0, "2020/07/31 12:00:00", 2, "おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 2, 24018, "2030/12/17 14:59:59", 613, 0.0, 24, 0.0, "ダイチ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113401, 0.0, "2020/07/31 12:00:00", 2, "きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 1, 24019, "2030/12/17 14:59:59", 211, 4.52, 24, 0.0, "ハツネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113401, 0.0, "2020/07/31 12:00:00", 2, "やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 1, 24020, "2030/12/17 14:59:59", 212, 3.89, 24, 0.0, "ハツネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113401, 0.0, "2020/07/31 12:00:00", 1, "よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 2, 24021, "2030/12/17 14:59:59", 213, 13.49, 24, 0.0, "ハツネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 106501, 0.0, "2020/07/31 12:00:00", 1, "いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 2, 24022, "2030/12/17 14:59:59", 311, 3.17, 24, 0.0, "カヤ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 106501, 0.0, "2020/07/31 12:00:00", 1, "どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 2, 24023, "2030/12/17 14:59:59", 312, 4.42, 24, 0.0, "カヤ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 106501, 0.0, "2020/07/31 12:00:00", 6, "なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 1, 24024, "2030/12/17 14:59:59", 313, 2.89, 24, 0.0, "カヤ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 102301, 0.0, "2020/07/31 12:00:00", 4, "あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 3, 24025, "2030/12/17 14:59:59", 421, 3.71, 24, 0.0, "アヤネ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192201, 0.0, "2020/07/31 12:00:00", 2, "いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 1, 24026, "2030/12/17 14:59:59", 721, 5.1, 24, 0.0, "アサヒ");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192301, 0.0, "2020/07/31 12:00:00", 1, "ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 3, 24027, "2030/12/17 14:59:59", 821, 4.34, 24, 0.0, "部員３");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 192501, 0.0, "2020/07/31 12:00:00", 1, "いい勝負だったよ\nまたやろうね", 1, 24028, "2030/12/17 14:59:59", 521, 0.0, 24, 0.0, "");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, -360.0, "2020/07/31 12:00:00", 1, "とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", 2, 24029, "2030/12/17 14:59:59", 101, 5.62, 24, 0.0, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, -360.0, "2020/07/31 12:00:00", 1, "頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", 2, 24030, "2030/12/17 14:59:59", 102, 9.58, 24, 0.0, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, -360.0, "2020/07/31 12:00:00", 2, "いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", 2, 24031, "2030/12/17 14:59:59", 103, 0.0, 24, 0.0, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, -360.0, "2020/07/31 12:00:00", 2, "夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", 1, 24032, "2030/12/17 14:59:59", 104, 9.13, 24, 0.0, "ミサト");
INSERT INTO `v1_361c05539f0a2aaf405bb253064073e8babd2dac99735d2ef75878fe719cb3fa` VALUES (10046, 113501, -360.0, "2020/07/31 12:00:00", 1, "絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", 2, 24033, "2030/12/17 14:59:59", 105, 8.27, 24, 0.0, "ミサト");
